import Cabecalho from '../../utils/cabecalho';
import Menu from '../../utils/menu';
import TabelaNoticias from './tabela-noticias';
import { 
    Container,
    Row,
    Col,
} from 'react-bootstrap';

function Noticias() {
    return ( 
        <div>
            <Cabecalho />
            <Container fluid>
                <Row>
                    <Col md={2}
                        className="vh-100" >
                            <Menu />
                    </Col>
                    <Col md={10} >
                        <TabelaNoticias />
                        
                    </Col>
                </Row>
            </Container>
        </div> 
     );
}

export default Noticias;
